package com.yishan.javaplus.worker;import com.amazonaws.services.sqs.AmazonSQS;import com.yishan.javaplus.worker.service.JmsSqsService;import org.checkerframework.checker.units.qual.A;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.boot.CommandLineRunner;import org.springframework.boot.SpringApplication;import org.springframework.boot.autoconfigure.SpringBootApplication;import org.springframework.context.ApplicationContext;import org.springframework.context.annotation.Bean;import org.springframework.jms.core.JmsTemplate;import java.util.Arrays;@SpringBootApplicationpublic class WorkerApplication {    public static void main(String[] args) {        SpringApplication.run(WorkerApplication.class, args);    }    @Bean    public CommandLineRunner commandLineRunner(ApplicationContext applicationContext) {        return args -> {            System.out.println("Let's inspect the beans provided by Spring Boot:");            String[] beanNames = applicationContext.getBeanDefinitionNames();            Arrays.sort(beanNames);            for (String beanName : beanNames) {                System.out.println(beanName);            }        };    }}